import React from 'react';

const About = () => {
  return (
    <div
      style={{
        minHeight: '100vh',
        background: 'linear-gradient(120deg, #fdfbfb, #ebedee)',
        backgroundAttachment: 'fixed',
        backgroundSize: 'cover',
      }}
    >
      <h1>About Page</h1>
      <p>Welcome to the About page!</p>
    </div>
  );
};

export default About;
